import tkinter as tk
from tkinter import ttk
from PIL import ImageTk, Image  
from base64 import b64decode

class Modelo(ttk.Frame):
    def __init__(self,notebook):
        super().__init__(notebook)
        self.texto=tk.Label(self,text="DIAGRAMA FORRESTER")
        self.imagen=""
        self.imagen_original = tk.PhotoImage(data=b64decode(self.imagen))
        self.imagen_lb=tk.Label(self, image=self.imagen_original)
        self.ubicar_componentes()
    
    def ubicar_componentes(self):
        self.texto.place(x=20,y=20)
        self.imagen_lb.place(x=50,y=40)